import LoginPage from  './pages/LoginPage/LoginPage.jsx'
import { Route, Routes, BrowserRouter } from "react-router-dom";


function App() {
    return (
      <BrowserRouter>
      <Routes>
              <Route exact path="/" element={ <LoginPage/> }></Route>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
